import base64
import os
import datetime

def file_decode(base_64, user_id=None, file_type=None):
    data = base_64.replace(' ', '+')
    cur_time = datetime.datetime.now().timestamp()

    filedata = base64.b64decode(data)

    filename = str(cur_time)+ '_ID_'+ str(user_id) +'.'+file_type  # I assume you have a way of picking unique filenames

    if file_type == 'jpg':
        completeName = os.path.join('../media/images', filename)
        with open(completeName, 'wb') as f:

            f.write(filedata)

        file_path = os.path.abspath(completeName)
        return file_path
    elif file_type == 'png':
        completeName = os.path.join('../media/images', filename)
        with open(completeName, 'wb') as f:
            f.write(filedata)

        file_path = os.path.abspath(completeName)
        return file_path

    elif file_type == 'mp3':
        completeName = os.path.join('mp3', filename)
        with open(completeName, 'wb') as f:
            f.write(filedata)

        file_path = os.path.abspath(completeName)
        return file_path


    else:
        completeName = os.path.join('../media/other_files', filename)
        print('completeName',completeName)
        with open(completeName, 'wb') as f:
            f.write(filedata)

        file_path = os.path.abspath(completeName)
        return file_path






